    [],nt"num_tags": 4,nt"name": "2004-alaska-highway-invasive-plants-pilot-survey",nt"isopen":
    false,nt"url": null,nt"notes": "We investigated the distribution and abundance
    of non-native invasive plants along a section of the Alaska Highway adjacent to
    Tetlin National Wildlife Refuge, 20 miles from the U.S. Customs station near the
    Canadian border in the summer of2004. Paired parallel transects were used to measure
    presence of invasive plants along the roadbed. Invasive plants accounted for 14%
    of all plant encounters. White sweetclover (Melilotus alba) was the most frequently
    encountered invasive plant (96%; n = 84). The method used did not detect a significant
    difference between the number of invasive plants found immediately adjacent to the
    roadbed and at 2 meters away from the roadbed. Recommendations for future surveys
    are made.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
